import React from 'react';

const customer = {
    'name': '홍길동',
    'birthday': '961222',
    'gender': '남자',
    'job': '대학생'
}
class Customer extends React.Component {
    render() {
        return (
            <Customer
                name={customer.name}
                birthday={customer.birthday}
                gender={customer.gender}
                job={customer.job}
            />
        );
    }
}

export default Customer;
